const Login = () => {
  return (
    <>
      <div>
        <input placeholder="email"></input>
        <input placeholder="password"></input>
        <button class='loginButt'>Login</button>
        Dont have an account? <a href="/"> Sign Up</a>
      </div>
    </>
  );
};

export default Login;
